    "2016-03-17T07:02:48.673667",nt"name": "real-property-tax-credit-circuit-breaker-beginning-tax-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "The Department of Taxation and Finance
    annually publishes statistical information on the New York State real property tax
    credit (RPTC).  Summary data are presented for taxpayers who were full-year New
    York state residents.  Taxpayers may claim the credit even if they had no New York
    State personal income tax liability and, therefore, were not required to file an
    income tax return.   Data are shown for the total number of claimants and credit
    claimed by county, age under and over 65, type of residence, filing category, and
    household gross income.",nt"license_title": "License Not Specified",nt"extras":
